import React from 'react';

import './Profile.css'

class Profile extends React.Component {
    render() {
        return (
            <div>
                <img className="profilePicture"></img>
                <div className="profileName">Mac</div>
                <div className="socialBar">
                    <div className="followers">23</div>
                    <div className="following">50</div>
                    <button className="btnFollow">Follow</button>
                </div>
            </div>
            )
    }
}

export default Profile;
